import styled from "@emotion/styled";
import { FC } from "react";
import { CommentsProps } from "./Table";
import { Box as MUIBox } from "@mui/system";
import { Icon, IconMed } from "./IconComponent/Icon";

const Box = styled(MUIBox)`
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  padding: 16px 24px;
  gap: 36px;
  top: 50%;
  left: 50%;
  width: 600px;
  height: 56px;
  position: absolute;
  /* Neutral / 1 */

  background: #ffffff;
  box-shadow: inset 0px -1px 0px #f0f0f0;

  /* Inside auto layout */

  flex: none;
  order: 0;
  align-self: stretch;
  flex-grow: 0;

  transform: translate(-50%, -50%);

  background-color: white;
  border-radius: 2px;
  box-shadow: "0px 3px 6px -4px rgba(0, 0, 0, 0.12), 0px 6px 16px rgba(0, 0, 0, 0.08), 0px 9px 28px 8px rgba(0, 0, 0, 0.05)";
  p: 4;
`;
export const ModalInfo = ({ com }: any) => {
  console.log(com);

  return (
    <>
      <Box>
        <h3>Comments</h3>
        <Icon type="Profile" />
        {com.map((i: any) => (
          <>
            <div
              style={{
                width: "24px",
                height: "24px",
                left: "0",
                top: "0",
                backgroundColor: "rgba(0, 40, 119, 0.45)",
                borderRadius: "15px",
                textAlign: "center",
                alignItems: "center",
              }}>
              <IconMed type="Profile" />
            </div><div>    {i.name} <span></span></div>


          </>
        ))}
        <button>close</button>
      </Box>
    </>
  );
};
